import { useNavigate } from "react-router-dom";
import "./Productsave.css";
import { useState } from "react";
import axios from "axios";
import { useDispatch, useSelector } from "react-redux";
import { productActions } from "../../toolkit/actions/product_action";

const Porductsave = () => {
  const navigate = useNavigate();
  const dispatch = useDispatch();
  const [product, setProduct] = useState({
    seller_id: "",
    category_code: "",
    product_name: "",
    product_price: "",
    product_count: "",
    filename: null,
  });

  const {
    seller_id,
    category_code,
    product_name,
    product_price,
    product_count,
    filename,
  } = product;

  const productDetail = useSelector((state) => state.product.productDetail);

  const handleValueChange = (e) => {
    setProduct((prev) => {
      return { ...prev, [e.target.name]: e.target.value };
    });
  };

  const handleFileChange = (e) => {
    e.preventDefault();
    setProduct((prev) => {
      return { ...prev, [e.target.name]: e.target.files[0] };
    });
  };

  const onSubmit = async (e) => {
    e.preventDefault();

    const formData = new FormData();
    formData.append("seller_id", seller_id);
    formData.append("category_code", category_code);
    formData.append("product_name", product_name);
    formData.append("product_price", product_price);
    formData.append("product_count", product_count);

    if (filename != null) formData.append("filename", filename);

    // console.log(formData);
    // await dispatch(productActions.getProductWrite(formData));

    // FormData 객체의 내용을 콘솔에 출력합니다.
    for (let [key, value] of formData.entries()) {
      console.log(`${key}: ${value}`);
    }

    // 파일이 선택되었는지 확인합니다.
    if (!filename) {
      alert("파일을 선택해주세요.");
      return; // 파일이 없으면 여기서 함수를 종료합니다.
    }

    try {
      await dispatch(productActions.getProductWrite(formData));
      alert("성공적으로 등록되었습니다.");
      navigate("/");
    } catch (error) {
      console.error("등록 실패", error);
    }

    setProduct({
      seller_id: "",
      category_code: "",
      product_name: "",
      product_price: "",
      product_count: "",
      filename: null,
    });

    navigate("/");
  };

  return (
    <>
      <h1 className="head">물품등록</h1>
      <form className="save" onSubmit={onSubmit}>
        <table>
          <tbody>
            <tr>
              <th>seller_id</th>
              <td>
                <input
                  type="text"
                  name="seller_id"
                  onChange={handleValueChange}
                ></input>
              </td>
            </tr>
            <tr>
              <th>category_code</th>
              <td>
                <input
                  type="text"
                  name="category_code"
                  onChange={handleValueChange}
                ></input>
              </td>
            </tr>
            <tr>
              <th>product_name</th>
              <td>
                <input
                  type="text"
                  name="product_name"
                  onChange={handleValueChange}
                ></input>
              </td>
            </tr>
            <tr>
              <th>product_price</th>
              <td>
                <input
                  type="text"
                  name="product_price"
                  onChange={handleValueChange}
                ></input>
              </td>
            </tr>
            <tr>
              <th>product_count</th>
              <td>
                <input
                  type="text"
                  name="product_count"
                  onChange={handleValueChange}
                ></input>
              </td>
            </tr>
            {/* <tr>
              <th width="20%" align="center">
                첨부파일
              </th>
              <td>
                <input
                  type="file"
                  name="filename"
                  id="filepath"
                  onChange={handleFileChange}
                />
              </td>
            </tr> */}
          </tbody>
        </table>
        <button type="submit" className="btn btn-primary">
          등록완료
        </button>
      </form>
    </>
  );
};

export default Porductsave;
